import PropTypes from 'prop-types'
function Student(props) {
    function checkPropName(name) {
        if (name == "Duc dep trai") {
            return true;
        } else {
            return false;
        }
    }
    const trueRes = <p>Name: {props.name} Age: {props.age}</p>;
    const falseRes = <p>hello this is not duc dep trai!</p>;
    return (
        <div>
            {checkPropName(props.name) ? trueRes : falseRes}
        </div>
    );
}
Student.propTypes = {
    name: PropTypes.string,
    age: PropTypes.number,
}
// Student.defaultProps = {
